var fileJSON=[{"path":"/glob/development-tools/versions/oneapi/gold/inteloneapi/dev-utilities/2021.1.1/include/dpc_common.hpp", "name":"dpc_common.hpp", "has_active_debug_locs":false, "absName":"/glob/development-tools/versions/oneapi/gold/inteloneapi/dev-utilities/2021.1.1/include/dpc_common.hpp", "content":"//==============================================================\012// Copyright  2020 Intel Corporation\012//\012// SPDX-License-Identifier: MIT\012// =============================================================\012\012#ifndef _DP_HPP\012#define _DP_HPP\012\012#pragma once\012\012#include <stdlib.h>\012#include <exception>\012\012#include <CL/sycl.hpp>\012\012namespace dpc_common {\012// this exception handler with catch async exceptions\012static auto exception_handler = [](cl::sycl::exception_list eList) {\012  for (std::exception_ptr const &e : eList) {\012    try {\012      std::rethrow_exception(e);\012    } catch (std::exception const &e) {\012#if _DEBUG\012      std::cout << \"Failure\" << std::endl;\012#endif\012      std::terminate();\012    }\012  }\012};\012\012// The TimeInterval is a simple RAII class.\012// Construct the timer at the point you want to start timing.\012// Use the Elapsed() method to return time since construction.\012\012class TimeInterval {\012 public:\012  TimeInterval() : start_(std::chrono::steady_clock::now()) {}\012\012  double Elapsed() {\012    auto now = std::chrono::steady_clock::now();\012    return std::chrono::duration_cast<Duration>(now - start_).count();\012  }\012\012 private:\012  using Duration = std::chrono::duration<double>;\012  std::chrono::steady_clock::time_point start_;\012};\012\012};  // namespace dpc_common\012\012#endif\012"}, {"path":"/home/u58822/One-API/oneAPI-samples/DirectProgramming/DPC++FPGA/Tutorials/Features/loop_ivdep/build/src/loop_ivdep.cpp", "name":"loop_ivdep.cpp", "has_active_debug_locs":false, "absName":"/home/u58822/One-API/oneAPI-samples/DirectProgramming/DPC++FPGA/Tutorials/Features/loop_ivdep/build/src/loop_ivdep.cpp", "content":"//==============================================================\012// Copyright Intel Corporation\012//\012// SPDX-License-Identifier: MIT\012// =============================================================\012#include <CL/sycl.hpp>\012#include <CL/sycl/INTEL/fpga_extensions.hpp>\012#include <iomanip>\012#include <iostream>\012\012// dpc_common.hpp can be found in the dev-utilities include folder.\012// e.g., $ONEAPI_ROOT/dev-utilities//include/dpc_common.hpp\012#include \"dpc_common.hpp\"\012\012constexpr size_t kRowLength = 128;\012constexpr size_t kMinSafelen = 1;\012constexpr size_t kMaxSafelen = kRowLength;\012constexpr size_t kMatrixSize = kRowLength * kRowLength;\012\012using namespace sycl;\012\012template <size_t safe_len> class KernelCompute;\012\012template <size_t safe_len>\012void TransposeAndFold(const device_selector &selector,\012                      const std::array<float, kMatrixSize> &m_input,\012                      std::array<float, kMatrixSize> &m_output) {\012  double kernel_time = 0;\012  try {\012  queue q(selector, dpc_common::exception_handler,\012          property::queue::enable_profiling{});\012\012    buffer buffer_input(m_input);\012    buffer buffer_output(m_output);\012\012    event e = q.submit([&](handler &h) {\012      accessor accessor_input(buffer_input, h, read_only);\012      accessor accessor_output(buffer_output, h, write_only, noinit);\012\012      h.single_task<KernelCompute<safe_len>>([=]()\012                                             [[intel::kernel_args_restrict]] {\012        float in_buffer[kRowLength][kRowLength];\012        float temp_buffer[kRowLength][kRowLength];\012\012        // Initialize local buffers\012        for (size_t i = 0; i < kMatrixSize; i++) {\012          in_buffer[i / kRowLength][i % kRowLength] = accessor_input[i];\012          temp_buffer[i / kRowLength][i % kRowLength] = 0;\012        }\012\012        // No iterations of the following loop store data into the same memory\012        // location that are less than kRowLength iterations apart.\012        // The ivdep here instructs the compiler that it can safely assume no\012        // loop-carried dependencies over safe_len consecutive iterations.\012        [[intel::ivdep(safe_len)]]\012        for (size_t j = 0; j < kMatrixSize * kRowLength; j++) {\012          #pragma unroll\012          for (size_t i = 0; i < kRowLength; i++) {\012            temp_buffer[j % kRowLength][i] += in_buffer[i][j % kRowLength];\012          }\012        }\012\012        // Write result to output\012        for (size_t i = 0; i < kMatrixSize; i++) {\012          accessor_output[i] = temp_buffer[i / kRowLength][i % kRowLength];\012        }\012      });\012    });\012\012    double start = e.get_profiling_info<info::event_profiling::command_start>();\012    double end = e.get_profiling_info<info::event_profiling::command_end>();\012\012    // unit is nano second, convert to ms\012    kernel_time = (double)(end - start) * 1e-6;\012\012  } catch (sycl::exception const &e) {\012    // Catches exceptions in the host code\012    std::cerr << \"Caught a SYCL host exception:\\n\" << e.what() << \"\\n\";\012\012    // Most likely the runtime couldn't find FPGA hardware!\012    if (e.get_cl_code() == CL_DEVICE_NOT_FOUND) {\012      std::cerr << \"If you are targeting an FPGA, please ensure that your \"\012                   \"system has a correctly configured FPGA board.\\n\";\012      std::cerr << \"Run sys_check in the oneAPI root directory to verify.\\n\";\012      std::cerr << \"If you are targeting the FPGA emulator, compile with \"\012                   \"-DFPGA_EMULATOR.\\n\";\012    }\012    std::terminate();\012  }\012\012  std::cout << \"safe_len: \" << safe_len << \" -- kernel time : \" << kernel_time\012            << \" ms\\n\";\012  std::cout << \"Throughput for kernel with safe_len \" << safe_len << \": \";\012  std::cout << std::fixed << std::setprecision(0)\012            << (((double)kMatrixSize * sizeof(float) * 1e-3f) /\012                (kernel_time * 1e-3f)) << \"KB/s\\n\";\012}\012\012int main() {\012  std::array<float, kMatrixSize> A, B, C;\012\012  // Initialize input with random data\012  for (size_t i = 0; i < kMatrixSize; i++) {\012    A[i] = static_cast<float>(rand()) / static_cast<float>(RAND_MAX);\012  }\012\012#if defined(FPGA_EMULATOR)\012  INTEL::fpga_emulator_selector selector;\012#else\012  INTEL::fpga_selector selector;\012#endif\012\012  // Instantiate kernel logic with the min and max correct safelen parameter\012  // to compare performance.\012  TransposeAndFold<kMinSafelen>(selector, A, B);\012  TransposeAndFold<kMaxSafelen>(selector, A, C);\012  // You can also try removing the ivdep from the kernel entirely and\012  // recompiling to see what effect this has on performance.\012\012  // Verify result\012  for (size_t i = 0; i < kMatrixSize; i++) {\012    if (B[i] != C[i]) {\012      std::cout << \"FAILED: The results are incorrect\" << '\\n';\012      return 1;\012    }\012  }\012  std::cout << \"PASSED: The results are correct\" << '\\n';\012  return 0;\012}\012"}];
